import React, { useState } from 'react';
import { PlusCircle } from 'lucide-react';

const Menu = () => {
  const [selectedCategory, setSelectedCategory] = useState('all');
  
  // Sample menu data
  const menuItems = [
    {
      id: 1,
      name: "Garlic Bread",
      description: "Freshly baked bread with garlic butter and herbs",
      price: 5.99,
      image: "/api/placeholder/400/200",
      category: "appetizer"
    },
    {
      id: 2,
      name: "Caesar Salad",
      description: "Crisp romaine lettuce with Caesar dressing, croutons and parmesan",
      price: 8.99,
      image: "/api/placeholder/400/200",
      category: "appetizer"
    },
    {
      id: 3,
      name: "Margherita Pizza",
      description: "Classic pizza with tomato sauce, mozzarella and fresh basil",
      price: 14.99,
      image: "/api/placeholder/400/200",
      category: "main"
    },
    {
      id: 4,
      name: "Beef Burger",
      description: "Juicy beef patty with lettuce, tomato, cheese and special sauce",
      price: 12.99,
      image: "/api/placeholder/400/200",
      category: "main"
    },
    {
      id: 5,
      name: "Spaghetti Bolognese",
      description: "Spaghetti with rich meat sauce, topped with parmesan",
      price: 15.99,
      image: "/api/placeholder/400/200",
      category: "main"
    },
    {
      id: 6,
      name: "Chocolate Cake",
      description: "Rich chocolate cake with chocolate ganache and fresh berries",
      price: 7.99,
      image: "/api/placeholder/400/200",
      category: "dessert"
    },
    {
      id: 7,
      name: "Sparkling Water",
      description: "Refreshing sparkling water with lime",
      price: 2.99,
      image: "/api/placeholder/400/200",
      category: "beverage"
    },
    {
      id: 8,
      name: "House Wine",
      description: "Glass of our house red or white wine",
      price: 8.99,
      image: "/api/placeholder/400/200",
      category: "beverage"
    }
  ];

  const filteredItems = selectedCategory === 'all' 
    ? menuItems 
    : menuItems.filter(item => item.category === selectedCategory);

  const addToCart = (item) => {
    console.log('Added to cart:', item);
    // Implement actual cart functionality
  };

  return (
    <div className="fade-in">
      <div className="flex justify-between items-center mb-6">
        <h2 className="text-2xl font-bold text-gray-800">Our Menu</h2>
        <div className="relative">
          <input
            type="text"
            placeholder="Search menu..."
            className="px-4 py-2 rounded-full border border-gray-300 focus:outline-none focus:ring-2 focus:ring-red-500 focus:border-transparent"
          />
        </div>
      </div>

      {/* Category Filter */}
      <div className="flex flex-wrap gap-2 mb-8">
        <button
          onClick={() => setSelectedCategory('all')}
          className={`px-4 py-2 rounded-full text-sm font-medium transition-colors ${
            selectedCategory === 'all'
              ? 'bg-red-600 text-white'
              : 'bg-gray-200 text-gray-800 hover:bg-gray-300'
          }`}
        >
          All
        </button>
        <button
          onClick={() => setSelectedCategory('appetizer')}
          className={`px-4 py-2 rounded-full text-sm font-medium transition-colors ${
            selectedCategory === 'appetizer'
              ? 'bg-red-600 text-white'
              : 'bg-gray-200 text-gray-800 hover:bg-gray-300'
          }`}
        >
          Appetizers
        </button>
        <button
          onClick={() => setSelectedCategory('main')}
          className={`px-4 py-2 rounded-full text-sm font-medium transition-colors ${
            selectedCategory === 'main'
              ? 'bg-red-600 text-white'
              : 'bg-gray-200 text-gray-800 hover:bg-gray-300'
          }`}
        >
          Main Dishes
        </button>
        <button
          onClick={() => setSelectedCategory('dessert')}
          className={`px-4 py-2 rounded-full text-sm font-medium transition-colors ${
            selectedCategory === 'dessert'
              ? 'bg-red-600 text-white'
              : 'bg-gray-200 text-gray-800 hover:bg-gray-300'
          }`}
        >
          Desserts
        </button>
        <button
          onClick={() => setSelectedCategory('beverage')}
          className={`px-4 py-2 rounded-full text-sm font-medium transition-colors ${
            selectedCategory === 'beverage'
              ? 'bg-red-600 text-white'
              : 'bg-gray-200 text-gray-800 hover:bg-gray-300'
          }`}
        >
          Beverages
        </button>
      </div>

      {/* Menu Items Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredItems.map((item) => (
          <div key={item.id} className="card group">
            <div className="relative">
              <img
                src={item.image}
                alt={item.name}
                className="card-img"
              />
              <span className={`absolute top-2 right-2 category-pill category-${item.category}`}>
                {item.category}
              </span>
            </div>
            <div className="card-body">
              <div className="flex justify-between items-start">
                <h3 className="card-title">{item.name}</h3>
                <span className="font-bold text-red-600">${item.price.toFixed(2)}</span>
              </div>
              <p className="card-text">{item.description}</p>
              <button
                onClick={() => addToCart(item)}
                className="mt-2 w-full btn btn-primary flex items-center justify-center gap-2"
              >
                <PlusCircle size={16} />
                Add to Cart
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Menu;
